/* env*/
function Env(name) {
  if (typeof globalThis.atob !== "function") {
    if (typeof Buffer !== "undefined") {
      globalThis.atob = s => Buffer.from(String(s), "base64").toString("binary");
      globalThis.btoa = s => Buffer.from(String(s), "binary").toString("base64");
    }
  }
  class Http {
    constructor(env){ this.env = env; }
    send(opts, method='GET'){
      opts = typeof opts === 'string' ? { url: opts } : (opts || {});
      let sender = this.get;
      if (method === 'POST') sender = this.post;
      if (method === 'PUT') sender = this.put;
      if (method === 'DELETE') sender = this.delete;
      return new Promise((resolve, reject) => {
        sender.call(this, opts, (err, resp, body) => err ? reject(err) : resolve(resp));
      });
    }
    get(o, cb){ if (this.env.isSurge()) $httpClient.get(o, cb); if (this.env.isQuanX()) { o.method='GET'; $task.fetch(o).then(r=>cb(null,r,r.body)).catch(e=>cb(e)); } }
    post(o, cb){ if (this.env.isSurge()) $httpClient.post(o, cb); if (this.env.isQuanX()) { o.method='POST'; $task.fetch(o).then(r=>cb(null,r,r.body)).catch(e=>cb(e)); } }
    put(o, cb){ if (this.env.isSurge()) $httpClient.put(o, cb); if (this.env.isQuanX()) { o.method='PUT'; $task.fetch(o).then(r=>cb(null,r,r.body)).catch(e=>cb(e)); } }
    delete(o, cb){ if (this.env.isSurge()) $httpClient.delete(o, cb); if (this.env.isQuanX()) { o.method='DELETE'; $task.fetch(o).then(r=>cb(null,r,r.body)).catch(e=>cb(e)); } }
  }
  return new (class {
    constructor(name){ this.name=name; this.http=new Http(this); }
    isSurge(){ return typeof $httpClient!=='undefined' && typeof $notification!=='undefined'; }
    isQuanX(){ return typeof $task!=='undefined'; }
    get(o,cb){ return this.http.get(o,cb); }
    post(o,cb){ return this.http.post(o,cb); }
    put(o,cb){ return this.http.put(o,cb); }
    delete(o,cb){ return this.http.delete(o,cb); }
    getdata(k){ return this.isSurge() ? $persistentStore.read(k) : this.isQuanX() ? $prefs.valueForKey(k) : ''; }
    setdata(v,k){ return this.isSurge() ? $persistentStore.write(v,k) : this.isQuanX() ? $prefs.setValueForKey(v,k) : false; }
    getScript(url){ return new Promise(r => { this.get({url}, (e,resp,body)=> r(body)); }); }
    msg(){ /* 静默 */ }
    log(){ /* 静默 */ }
    done(v={}){ $done(v); }
  })(name);
}

